import { createSlice, current } from '@reduxjs/toolkit';
export const userData =(data,newUserList)=>{
    const newData =newUserList.following.map((i,item)=>item[i] !== current(data.following[i]) ? newUserList : data )
    console.log(newData)
    return newData[0]
}
